package Calculator.View;

import java.io.IOException;
import java.io.InputStream;
import java.io.PrintStream;

public class EnglishView {
	private PrintStream printer;
	private InputStream input;;

	public EnglishView(PrintStream p, InputStream in) {
		this.printer = p;
		this.input = in;
	}

	public void instructionPrint() {
		printer.println("Welcome to calculator");
		printer.println("Enter:\n" + "s: standard calculator\n" + "d: advanced calculator\n"
				+ "f: First Degree Equation Calculator a.x + b = 0\n"
				+ "q: Quadratic Equatio Calculator a.x^2 + b.x + c = 0\n" + "e: exit");
	}

	public void standardInstructionDisplay() {
		printer.println("Welcome to the standard calculator for (+,-,*,/,%) operations.");
	}

	public void advancedInstructionDisplay() {
		printer.println("Welcome to the advanced calculator for (square root, power) operations.");
	}

	public void standardResultPrint(double result) {
		printer.println("result: " + result);
	}

	public void askToNumberOrOperation(int i) {
		switch (i) {
		case 1:
			printer.println("Enter the first number A:");
			break;
		case 2:
			printer.println("Enter the second number B:");
			break;
		case 3:
			printer.println("Enter the third number C:");
			break;
		case 0:
			printer.println("Enter the operation (+,-,*,/,%) or c to cancel: ");
			break;
		default:
			printer.println("Enter the operation s:Square Root, p: power, c:cancel");
		}

	}

	public void printText(String text) {
		printer.println(text);
	}

	public double getUserInputNumber() {
		String text = "";
		while (text.replaceAll("\\s+", "").isEmpty()) {
			text = getInput();
		}
		try {
			double d = Double.parseDouble(text);
			return d;
		} catch (NumberFormatException e) {
			if (text.charAt(0) == 'c')
				return Double.MAX_VALUE;
			printer.println("invalid number please try again, 'c' for cancel");
			return Double.MIN_VALUE;
		}

	}

	public char getUserInputChar() {
		String text = "";
		while (text.replaceAll("\\s+", "").isEmpty()) {
			text = getInput();
		}
		return text.charAt(0);
	}

	public void waitToEnter() {
		printer.println("Press Enter to continue...");
		getInput();
	}

	public String getInput() {
		StringBuilder sb = new StringBuilder();
		try {
			input.skip(input.available());
			char c = '\n';
			c = (char) input.read();
			sb.append(c);
			int a = input.available() - 2;
			while (a > 0) {
				c = (char) input.read();
				sb.append(c);
				a--;
			}
			input.skip(input.available());
			return sb.toString();
		} catch (IOException e) {
			return sb.toString();
		}
	}

}

package Calculator.controller;

import java.util.Arrays;
import java.util.List;

import Calculator.View.EnglishView;
import Calculator.model.AdvancedCalculator;
import Calculator.model.Equation;
import Calculator.model.FirstDegreeEquationCalculator;
import Calculator.model.QuadraticEquationCalculator;
import Calculator.model.StandardCalculator;
import Calculator.model.exeption.NonFirstDegreeEquatioException;
import Calculator.model.exeption.NonQuadraticEquatioException;

public class Controller {
	private EnglishView view;
	private StandardCalculator sc;
	private AdvancedCalculator AC;
	private FirstDegreeEquationCalculator FDC;
	private QuadraticEquationCalculator QEC;
	private Equation equation;

	public Controller(EnglishView view, StandardCalculator sc, AdvancedCalculator ac, FirstDegreeEquationCalculator FDC,
			QuadraticEquationCalculator QEC, Equation equation) {
		this.view = view;
		this.sc = sc;
		this.AC = ac;
		this.FDC = FDC;
		this.QEC = QEC;
		this.equation = equation;
	}

	public boolean start() {
		view.instructionPrint();
		char input = view.getUserInputChar();

		if (input == 's') {
			double result = standardCalculator();
			if (result != Double.MIN_VALUE) {
				view.standardResultPrint(result);
				view.waitToEnter();
			}

		} else if (input == 'd') {
			double result = advancedCalculator();
			if (result != Double.MIN_VALUE) {
				view.standardResultPrint(result);
				view.waitToEnter();
			}
		} else if (input == 'f') {
			double result = FirstDegreeEquationCalculator();
			if (result != Double.MIN_VALUE) {
				view.standardResultPrint(result);
				view.waitToEnter();
			}
		} else if (input == 'q') {
			double result = QuadraticEquatioCalculator();
			if (result != Double.MIN_VALUE) {
				double numberOfSolution = QEC.getNumberOfSolutions();
				double result1 = QEC.getSolution1();
				double result2 = QEC.getSolution2();
				if (numberOfSolution == 2) {
					view.standardResultPrint(result1);
					view.standardResultPrint(result2);
				} else if (numberOfSolution == 1) {
					view.standardResultPrint(result1);
				} else {
					view.printText("*****No Solution*****");
				}
				view.waitToEnter();

			}

		}
		return input != 'e';

	}

	public double standardCalculator() {
		view.standardInstructionDisplay();
		double result = Double.MIN_VALUE;
		double number1 = Double.MIN_VALUE;
		double number2 = Double.MIN_VALUE;
		char operation = Character.MIN_VALUE;

		number1 = getNumberFromUser(1);
		if (number1 == Double.MAX_VALUE)
			return Double.MIN_VALUE;

		operation = getOperationFromUser(Arrays.asList('+', '-', '*', '/', '%', 'c'), false);
		if (operation == 'c')
			return Double.MIN_VALUE;

		number2 = getNumberFromUser(2);
		if (number2 == Double.MAX_VALUE)
			return Double.MIN_VALUE;

		switch (operation) {
		case '+':
			result = sc.sum(number1, number2);
			break;
		case '-':
			result = sc.subtract(number1, number2);
			break;
		case '*':
			result = sc.mul(number1, number2);
			break;
		case '/':
			try {
				result = sc.divide(number1, number2);
			} catch (IllegalArgumentException e) {
				view.printText("Error*****" + e.getMessage() + "*****\n");
				return Double.MIN_VALUE;
			}
			break;
		case '%':
			try {
				result = sc.mod(number1, number2);
			} catch (IllegalArgumentException e) {
				view.printText(e.getMessage() + "\n");
				return Double.MIN_VALUE;
			}
			break;
		}
		return result;
	}

	public double advancedCalculator() {
		view.advancedInstructionDisplay();
		double result = Double.MIN_VALUE;
		double number1 = Double.MIN_VALUE;
		double number2 = Double.MIN_VALUE;
		char operation = Character.MIN_VALUE;

		number1 = getNumberFromUser(1);
		if (number1 == Double.MAX_VALUE)
			return Double.MIN_VALUE;

		operation = getOperationFromUser(Arrays.asList('s', 'p', 'c'), true);
		if (operation == 'c')
			return Double.MIN_VALUE;

		if (operation == 's') {
			try {
				result = AC.squareRoot(number1);
			} catch (IllegalArgumentException e) {
				view.printText("Error*****" + e.getMessage() + "*****\n");
				return Double.MIN_VALUE;
			}

		} else {
			number2 = getNumberFromUser(2);
			if (number2 == Double.MAX_VALUE)
				return Double.MIN_VALUE;
			result = AC.power(number1, number2);
		}

		return result;
	}

	public double FirstDegreeEquationCalculator() {
		double result = Double.MIN_VALUE;
		double number1 = Double.MIN_VALUE;
		double number2 = Double.MIN_VALUE;

		number1 = getNumberFromUser(1);
		if (number1 == Double.MAX_VALUE)
			return Double.MIN_VALUE;

		number2 = getNumberFromUser(2);
		if (number2 == Double.MAX_VALUE)
			return Double.MIN_VALUE;

		FDC.setB(number1);
		FDC.setC(number2);
		try {
			result = FDC.getSolution();
		} catch (NonFirstDegreeEquatioException e) {
			view.printText("Error*****Non First Degree Equatio*****\n");
			return Double.MIN_VALUE;
		}
		return result;
	}

	public double QuadraticEquatioCalculator() {
		double number1 = Double.MIN_VALUE;
		double number2 = Double.MIN_VALUE;
		double number3 = Double.MIN_VALUE;

		number1 = getNumberFromUser(1);
		if (number1 == Double.MAX_VALUE)
			return Double.MIN_VALUE;

		number2 = getNumberFromUser(2);
		if (number2 == Double.MAX_VALUE)
			return Double.MIN_VALUE;

		number3 = getNumberFromUser(3);
		if (number3 == Double.MAX_VALUE)
			return Double.MIN_VALUE;
		equation.setABC(number1, number2, number3);
		QEC.setEquation(equation);
		try {
			QEC.startSolving();
		} catch (NonQuadraticEquatioException e) {
			view.printText("Error*****Non Quadratic Equatio*****\n");
			return Double.MIN_VALUE;
		}
		return 1;

	}

	public double getNumberFromUser(int i) {
		view.askToNumberOrOperation(i);
		double number = Double.MIN_VALUE;
		while (number == Double.MIN_VALUE) {
			number = view.getUserInputNumber();
		}
		return number;
	}

	public char getOperationFromUser(List<Character> list, boolean isAdvanced) {
		char operation = '0';
		while (!list.contains(operation)) {
			if (isAdvanced)
				view.askToNumberOrOperation(-1);
			else
				view.askToNumberOrOperation(0);
			operation = view.getUserInputChar();
		}
		return operation;
	}

}

package Calculator.model;

public class AdvancedCalculator {

	public double squareRoot(double positiveNumber) {
		if (positiveNumber >= 0) {
			return Math.sqrt(positiveNumber);
		}
		throw new IllegalArgumentException("Can not Square Root a negative number");
	}

	public double power(double number, double exponent) {
		return Math.pow(number, exponent);
	}

}

package Calculator.model;

public class Equation {
	double a, b, c;

	public Equation(double a, double b, double c) {
		this.a = a;
		this.b = b;
		this.c = c;
	}

	public double getA() {
		return a;
	}

	public double getB() {
		return b;
	}

	public double getC() {
		return c;
	}

	public void setABC(double a, double b, double c) {
		this.a = a;
		this.b = b;
		this.c = c;
	}

}

package Calculator.model;

import Calculator.model.exeption.NonQuadraticEquatioException;

public class EquationDiscriminantCalculator {
	double a, b, c;

	public EquationDiscriminantCalculator(Equation equation) {
		a = equation.getA();
		b = equation.getB();
		c = equation.getC();
	}

	public double getDiscriminant() throws NonQuadraticEquatioException {
		if (a == 0) {
			throw new NonQuadraticEquatioException();
		}
		StandardCalculator SC = new StandardCalculator();
		AdvancedCalculator AC = new AdvancedCalculator();
		double A_mul_C = SC.mul(a, c);
		return AC.power(b, 2) - SC.mul(4, A_mul_C);
	}

	public void setA(double a) {
		this.a = a;
	}

	public void setB(double b) {
		this.b = b;
	}

	public void setC(double c) {
		this.c = c;
	}
}

package Calculator.model;

import Calculator.model.exeption.NonFirstDegreeEquatioException;

public class FirstDegreeEquationCalculator {

	private double a, b, c;
	private double Solution;

	public FirstDegreeEquationCalculator(Equation equation) {
		a = equation.getA();
		b = equation.getB();
		c = equation.getC();
	}

	private void startSolving() throws NonFirstDegreeEquatioException {
		if (a != 0 || b == 0) {
			throw new NonFirstDegreeEquatioException();
		}
		StandardCalculator SC = new StandardCalculator();
		Solution = SC.divide(-c, b);
	}

	public double getSolution() throws NonFirstDegreeEquatioException {
		this.startSolving();
		return Solution;
	}

	public void setB(double b) {
		this.b = b;
	}

	public void setC(double c) {
		this.c = c;
	}

}

package Calculator.model;

import Calculator.model.exeption.NonQuadraticEquatioException;

public class QuadraticEquationCalculator {
	private Equation equation;
	StandardCalculator SC;
	AdvancedCalculator AC;
	EquationDiscriminantCalculator EDC;

	private double Discriminant, Solution1, Solution2;

	private int numberOfSolutions;

	public QuadraticEquationCalculator(Equation equation, StandardCalculator SC, AdvancedCalculator AC,
			EquationDiscriminantCalculator EDC) {
		this.SC = SC;
		this.AC = AC;
		this.EDC = EDC;
		this.equation = equation;
	}

	public void startSolving() throws NonQuadraticEquatioException {
		this.Discriminant = EDC.getDiscriminant();
		if (getDiscriminant() > 0) {
			numberOfSolutions = 2;
			firstSolution();
			secondSolution();
		}

		else if (getDiscriminant() == 0) {
			numberOfSolutions = 1;
			firstSolution();
			secondSolution();
		} else {
			numberOfSolutions = 0;
			Solution1 = Double.MIN_VALUE;
			Solution2 = Solution1;
		}
	}

	private void firstSolution() {
		Solution1 = SC.divide(SC.subtract(-equation.getB(), AC.squareRoot(Discriminant)), SC.mul(2, equation.getA()));
	}

	private void secondSolution() {
		if (getNumberOfSolutions() == 1) {
			Solution2 = Solution1;
			return;
		}
		Solution2 = SC.divide(SC.sum(-equation.getB(), AC.squareRoot(Discriminant)), SC.mul(2, equation.getA()));
	}

	public double getSolution1() {
		return Solution1;
	}

	public double getSolution2() {
		return Solution2;
	}

	public int getNumberOfSolutions() {
		return numberOfSolutions;
	}

	public double getDiscriminant() {
		return Discriminant;
	}

	public void setEquation(Equation equation) {
		this.equation = equation;
		this.EDC.setA(equation.getA());
		this.EDC.setB(equation.getB());
		this.EDC.setC(equation.getC());
	}

}

package Calculator.model;

public class StandardCalculator {

	public double sum(double number1, double number2) {
		return number1 + number2;
	}

	public double subtract(double number1, double number2) {
		return number1 - number2;
	}

	public double mul(double number1, double number2) {
		return number1 * number2;
	}

	public double divide(double number1, double number2) {
		if (number2 != 0) {
			return number1 / number2;
		}
		throw new IllegalArgumentException("Number2 'divisor' is 0");
	}

	public double mod(double number1, double number2) {
		if (number2 != 0) {
			return number1 % number2;
		}
		throw new IllegalArgumentException("Number2 'divisor' is 0");
	}
}

